-- Create user table
CREATE TABLE users (
    user_id SERIAL PRIMARY KEY,
    name VARCHAR(40) NOT NULL,
    gender VARCHAR(10) NOT NULL CHECK (gender IN ('Male', 'Female', 'Other')),
    email VARCHAR(100) UNIQUE NOT NULL,
    password_hash VARCHAR(100) NOT NULL,
    role VARCHAR(20) NOT NULL CHECK (role IN ('ADMIN', 'MEMBER', 'LIBRARIAN')),
    status VARCHAR(20) NOT NULL CHECK (status IN ('ACTIVE', 'INACTIVE', 'SUSPENDED')),
    date_of_birth DATE,
    date_joined DATE NOT NULL
);

-- Create book table
CREATE TABLE book (
    book_id SERIAL PRIMARY KEY,
    title VARCHAR(100) NOT NULL,
    language VARCHAR(30),
    author VARCHAR(70) NOT NULL,
    rating REAL,
    isbn VARCHAR(15) NOT NULL,
    book_format VARCHAR(15),
    pages INTEGER,
    num_ratings INTEGER,
    liked_percent SMALLINT,
    price NUMERIC(10, 2),
    cover_img TEXT,
    publication_year INTEGER,
    quantity INTEGER,
    CONSTRAINT publication_year_check CHECK (publication_year >= 0),
    CONSTRAINT rating_check CHECK (rating >= 0 AND rating <= 5),
    CONSTRAINT liked_percent_check CHECK (liked_percent >= 0 AND liked_percent <= 100),
    CONSTRAINT num_ratings_check CHECK (num_ratings >= 0),
    CONSTRAINT price_check CHECK (price >= 0),
    CONSTRAINT pages_check CHECK (pages >= 0)
);

-- Create genre table
CREATE TABLE genre (
    genre_id SERIAL PRIMARY KEY,
    name VARCHAR(50) NOT NULL UNIQUE
);

-- Create book_genre table
CREATE TABLE book_genre (
    book_id INTEGER NOT NULL,
    genre_id INTEGER NOT NULL,
    PRIMARY KEY (book_id, genre_id),
    FOREIGN KEY (book_id) REFERENCES book(book_id) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (genre_id) REFERENCES genre(genre_id) ON DELETE CASCADE ON UPDATE CASCADE
);

-- Create borrow_book table
CREATE TABLE borrow_book (
    borrow_id SERIAL PRIMARY KEY,
    user_id INTEGER NOT NULL,
    book_id INTEGER NOT NULL,
    borrow_date DATE NOT NULL,
    due_date DATE NOT NULL,
    returned_date DATE,
    fine INTEGER,
    status INTEGER NOT NULL, -- BORROWED: 0, RETURNED: 1, OVERDUE: 2
    FOREIGN KEY (user_id) REFERENCES users(user_id) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (book_id) REFERENCES book(book_id) ON DELETE CASCADE ON UPDATE CASCADE
);

-- Create book_request table
CREATE TABLE book_request (
    request_id SERIAL PRIMARY KEY,
    user_id INTEGER NOT NULL,
    book_id INTEGER NOT NULL,
    librarian_id INTEGER,
    request_date DATE NOT NULL,
    status INTEGER, -- 'Pending': 0, 'Approved': 1, 'Rejected': 2
    approval_date DATE,
    FOREIGN KEY (user_id) REFERENCES users(user_id) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (book_id) REFERENCES book(book_id) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (librarian_id) REFERENCES users(user_id) ON DELETE SET NULL -- Reference to admin approving the request
);



